class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        # Faster solution.
        start_from_index = 0
        for i in range(0, len(s)):
            try:    
                start_from_index += t[start_from_index:].index(s[i]) + 1
            except: return False
        return True

    def is_subsequence_2(self, s: str, t: str) -> bool:
        # Slower solution, due to more number of checks in each loops
        if len(s) == 0: return True
        i = j = 0
        while j < len(t) and i < len(s):
            if t[j] == s[i]:
                i += 1
            j += 1
        # if i == len(s): return True
        # return False
        # Instead of the above two lines, do the following:
        return i == len(s)
    
    def is_subsequence_3(self, s: str, t: str) -> bool:
        # Using find()
        start_from_index = -1
        for i in s:
            start_from_index = t.find(i, start_from_index+1)
            if start_from_index == -1:  return False
        return True

s = Solution()
print(s.is_subsequence_2("abc", "ahbgdc"))
print(s.is_subsequence_2("axc", "ahbgdc"))
print(s.is_subsequence_2("leeeeetcode", ""))